import React from 'react';
import ProgressUpdater from './ProgressUpdater';
import Hint from './Hint';

class ForEachLoop extends React.Component{
	constructor(props){
		super(props)
		this.state={
			progress: "todo"
		}
	}

	updateProgressState(progress){
		this.setState({
			progress: progress
		});
	}

	render(){
		return (
			<div>
				<ProgressUpdater
	              page={this.props.page} 
	              user={this.props.user}
	              progress={this.state.progress}
	              update={(progress)=>this.updateProgressState(progress)}
	            />
	            remember when we talked about <b>good ol' for loops</b>? (<b className="note">psst. need a reminder</b> on what these good ol' for loops are? check out the <b className="pageName">for loop page</b>!) well there's actually another type of for loop that we haven't talked about yet. (<b className="note">btw:</b> sry for hiding secrets from you... do you forgive us?) it's called a <b>for-each loop</b>!
	            <h3>a for-each loop? ngl that sounds kinda lame</h3>
	            well it isn't.
	            <div className="code">
	            System.out.print("haters. back. off.");
	            </div>
	            <h3>only positive vibes allowed beyond this point !!</h3>
	            for-each loops are used to <b>iterate through arrays and other collections that we will talk about later</b>. burning to know how to make one yourself? here is the blueprint for constructing a for-each loop:
	            <br/>
	            <b>
	            for(<i>&lt;type&gt;</i> <i>&lt;item&gt;</i> : <i>&lt;array&gt;</i>)&#123;
	            <br/>
	        	<p>
	        		*code*
	        	</p>
	            <br/>
	            &#125;
	            </b>
	            <br/>
	            <br/>
	            let's walk through each of these components – but in a <b>backwards order</b> because that makes it the easiest to understand:
	            <ul>
	            	<li><b>array</b> – the array or collection you want to iterate through</li>
	            	<li><b>item</b> – each value in the array or collection is stored in this variable each iteration</li>
	            	<li><b>type</b> – the type of the values in the array or collection</li>
	            </ul>
	            here's a common example of the use of a for-each loop: let's <b>print the elements of an array</b>.
	            <div className="code">
	            String[] colors = &#123;"red", "orange", "yellow", "green", "blue", "indigo", "violet"&#125;;
	            <br/>
	            for(String color : colors) &#123;
				<br/>
				<p>
					System.out.println(color);
				</p>
				<br/>
				&#125;
	            </div>
	            can you guess what shows up in the console? (<b className="note">hint:</b> what is <i>color</i> storing? an index or the actual value?) take a look at the console below, which <b>displays each value in our <i>colors</i> array</b>:
	            <div className="code">
	            red<br/>
	            orange<br/>
	            yellow<br/>
	            green<br/>
	            blue<br/>
	            indigo<br/>
	            violet
	            </div>
	            <ProgressUpdater
	              page={this.props.page} 
	              user={this.props.user}
	              progress={this.state.progress}
	              update={(progress)=>this.updateProgressState(progress)}
	            />
	            ...we know <b className="note">just for java</b> is as <b>addicting</b> as the newest Netflix binge, so what are you waiting for? <b className="pageName">keep coding!</b>
			</div>
		)
	}
}

export default ForEachLoop;
